// STYLES
import './component-styles/Home.css'

// COMPONENTS
import HeroBanner from './HeroBanner';
import NavMenu from './NavMenu';
import TallTeaser from './TallTeaser';

const Home = () => {
  return (
    <div className="home">
      <HeroBanner />
      <NavMenu />
      <TallTeaser />
    </div>
  )
};

export default Home;
